         address: '',
         username: '',
         profilePicture: '',
         email: '',
         password: '',
         emailMessage: '',
         passwordMessage: ''
      }
    }

  render() {
    return (
      <div className="register-wrapper">


      </div>
    )
  }
}

export default Register;
